export const DELETE_TODO = 'DELETE_TODO';

export const deleteTodo = (list, id) => {
    console.log('remove');
    console.log(id);
    const newList = list.todoList.filter(item => item.id === id);
    console.log(newList);
    return {
        type: DELETE_TODO,
        payload: newList
    }
};
